function Password(props) {

    const {delta} = props
    let passVal = ''

    function PassSrrength(){
        if(delta < 100){
            passVal =  "weak";
        }
        if(delta >= 100 && delta <= 1000000) {
            passVal =  "medium"
        }
        if(delta > 1000000){
            passVal = "strong!"
        }

        return passVal
    }

  return (
    <div className="isValidPass">
        <h1> {passVal}</h1>
    </div>
  );
}

export default Password;
